import React from "react";

const Home = () => (
  <header className="w3-container w3-padding-32 w3-center w3-black" id="home">
    <h1 className="w3-jumbo"><span className="w3-hide-small">I'm</span> Nishant Sharma.</h1>
    <p>Explorer and web Developer.</p>
    <img src="/images/IMG_0305.jpg" alt="profile" className="w3-image" width="800" height="900" />
  </header>
);

export default Home;
